import './App.css';
import Component from './Component';

function App() {
  return (
    <div className = "App" style = { { width : "720px", alignItems : "center" } }>
      <div className = "grid">
        <Component name = "파이리" />
        <Component name = "꼬부기" />
        <Component name = "피카츄" />
      </div>
    </div>
  );
}

export default App;
